# 1 "Lex.fsl"
 
 (* File MicroC/CLex.lex
    Lexer specification for micro-C, a small imperative language
  *)

module CLex
  
open Microsoft.FSharp.Text.Lexing
open CPar;

let lexemeAsString lexbuf = 
    LexBuffer<char>.LexemeString lexbuf

(* Scan keywords as identifiers and use this function to distinguish them. *)
(* If the set of keywords is large, use a hashtable instead.               *)

let keyword s =
    match s with
    | "Gcd"     -> GCD
    | "Mcm"     -> MCM
    | "Abs"     -> ABS
    | "char"    -> CHAR 
    | "default" -> DEFAULT
    | "do"      -> DO
    | "else"    -> ELSE
    | "false"   -> CSTBOOL 0
    | "for"     -> FOR
    | "if"      -> IF
    | "int"     -> INT
    | "float"   -> FLOAT
    | "null"    -> NULL
    | "print"   -> PRINT
    | "println" -> PRINTLN
    | "return"  -> RETURN
    | "true"    -> CSTBOOL 1
    | "void"    -> VOID 
    | "while"   -> WHILE     
    | "Sort"    -> SORT
    | "Max"     -> MAX
    | "Min"     -> MIN
    | "Swap"    -> SWAP
    | "Switch"  -> SWITCH    
    | "Case"    -> CASE
    | _         -> NAME s
 
let cEscape s = 
    match s with 
    | "\\\\" -> '\\'
    | "\\\"" -> '\"'
    | "\\a"  -> '\007'
    | "\\b"  -> '\008'
    | "\\t"  -> '\t'
    | "\\n"  -> '\n'
    | "\\v"  -> '\011'
    | "\\f"  -> '\012'
    | "\\r"  -> '\r'
    | _      -> failwith "Lexer error: impossible C escape"

